import ChartBar from './ChartBar'
function Chart(props){
    const d=props.items.map(e=>e.value);
    const maxValue=Math.max(...d);
    return <div>
        {props.items.map((exp)=>(
             <ChartBar title={exp.label} maxValue={maxValue} value={exp.value}
                    />
        
        ))}
    </div>
};

export default Chart;
